('node/add/community-task', '', '', 'node_access', 'a:2:{i:0;s:6:"create";i:1;s:14:"community_task";}', 'node_add', 'a:1:{i:0;i:2;}', 7, 3, '', 'node/add/community-task', 'Community tasks', 'check_plain', '', 6, '', 'A way to post tasks the community needs volunteers for, for members to volunteer for those tasks, and to be credited when the tasks are done.Tasks have three states - open, committed, and completed.', '', 0, 'modules/node/node.pages.inc'),
