INSERT INTO `node_revisions` (`nid`, `vid`, `uid`, `title`, `body`, `teaser`, `log`, `timestamp`, `format`) VALUES
(1, 1, 0, 'Community Coins', 'This is the default currency', '', '', 1306463565, 0),
(2, 2, 0, 'Home', '<img src="/money-go-round.gif" align="right" style="margin:0 0 7em 1.5em" />\n<p>This is the English demo version of the Community Forge''s standard installation. It shows these four main pages to everyday secondary-links. To get a good idea of the member experience, start by logging in using one of the member ids, (taking note of the role in brackets) then you can:<ul>\n<li>Start transactions with other users</li>\n<li>add offers and wants to the directory</li>\n<li>edit your other offers and wants</li>\n<li>Change your profile information</li></ul>\nThen you may log in as a committee members (they are listed on the left), and you will be able to<ul>\n<li>edit announcements, FAQ, pages and categories</li>\n<li>create Requests & acknowledgements</li>\n<li>manage images</li></ul>\nDon''t worry about breaking anything, the site is refreshed every 15 minutes!\nThis software is ready for your community to use, and we are working round the clock and round the world to improve this service!', '', '', 1306465371, 2),
(3, 3, 0, 'Share...', '<strong>Join us and share </strong>\nThe local exchange systems gives you many opportunities to share.\n\n<strong>Put your new members information here</strong>\n\nBackground, information, directions, times, locations.\n\n<strong>Share collective tasks</strong>\nEach association is only the sum of the actions of its members. That is why it is important to share the tasks related to the proper functioning thereof. The heading "Tasks" facilitates and encourages their distribution. Some tasks for the association may be paid in time or units. Solidarity contributions gain LETS for payment.\n\n\n <strong> <a href="/echanger"> Share your knowledge, your property - Exchange </a> </strong>', '', '', 1306465371, 2),
(4, 4, 0, 'Getting Started', '<strong>How it works</ strong>\n\n<p> Offers and wants appear on our website or catalog. A member makes contact with another member to make an exchange. Members agree on its value, and make the exchange. Then, an e-member exchange takes on the site, the other confirms and finally the exchange is recognized.</p>\n\n<p>Some tasks for the association may be paid in grain of salt. Solidarity contributions in local currency is seen to reward those tasks. </ P>\n\n<p>An annual fee in Swiss francs (CHF 30, CHF from July 20) is charged to cover the operating costs of the association (stamps, photocopies, ...)</ p>\n\n<p>A monthly meeting to exchange information is held. There is a general meeting every year. </ P>\n\n\n<p><strong> Start by <a href="/share"> Sharing </ a> </ strong> </ p>', '', '', 1306465372, 2),
(5, 5, 0, 'Commitment is Enriching!', '<strong>Example: To become a member of LETS </strong>\n<ol><li>Browse our site to better understand the system.</li>\n<li>Contact members/attend orientation meeting, put information here.</li>\n<li>Filling out registration form, put link to form here.</li>\n<li>Fee to pay, how much, where/who/how to pay information here.</li>\n<li>Details of how the process continues after payment.</li>\n<li>Welcome to the LETS. To share and enrich you!</li></ol>', '', '', 1306465372, 1),
(6, 6, 0, 'SEL', '<strong>A propos des SELs :</strong>\n<a href="http://www.lets-linkup.com/400-RestOfEurope.htm">LETS-linkup.com</a> - le site propose la liste des SELs présents dans chaque pays dont la Suisse. Incomplet mais utile.\n<a href="http://www.selidaire.org/">Selidaire</a> - informations générales sur le fonctionnement des SELs, forums, ...\n<a href="http://transversel.apinc.org/">Transversel</a> - information à propos des SELs. A jour, le plus vivant en français.\n<a href="http://www.imaginer.ch/eba/textes/sel.html">Imaginer</a> - aperçu historique des divers systèmes de troc (dont les SELs) présents à Genève.\n\n<strong>SELs en Suisse :</strong>\n<a href="http://www.sel-suisse.ch">SELs Suisse</a> - systèmes d''échange locaux de la Chaux-de-Fonds, du Val-de-Ruz (sel vaudruzien) et du Littoral neuchâtelois (sel des rives) se présentent.\n<a href="http://www.sel-lausanne.net">SEL Lausanne</a> - visitez nos chers voisins Lausannois.\n<a href="http://www.tauschnetz.ch"> Tauschnetz</a> - la plupart des SELs de Suisse.\n\n<strong>Pourquoi entrer dans un SEL ? <a href=pourquoisel">cliquez ici ></a></strong>\n\n<strong>Questions > Réponses sur les Sels</strong>\n<em>Unité d''échange</em>\n-L’unité d’échange, le grain, permet de mesurer les échanges entre adhérents.\n\n<em>Mais c’est du troc !</em>\n-Pas du tout. Dans le troc, deux personnes échangent au même moment deux choses qui ont à peu près la même valeur. Dans le SEL, les grains permettent de transférer, à différentes personnes et différents moments, des services, des savoirs ou des biens qui ont des valeurs différentes.\n\n<em>Les grains de SEL et les Francs, c’est pareil ?</em>\n-Non, car, pour dépenser des Francs, il faut d’abord en posséder. Alors qu’avec un compte à zéro je peux échanger tout de suite.\n-Non, parce que les grains ne sont pas convertibles en Francs, ni les Francs en grains.\n-Non, car il s’agit d’une monnaie locale sans utilisation en dehors de l’association.\n-Non, car cette monnaie locale n’est pas capitalisable, ne produit pas d’intérêts et n’est donc pas spéculative.\n\n<em>Qui fixe la valeur ?</em>\n-Les adhérents sont libres de fixer la valeur qu’ils veulent suivant le plaisir, la difficulté ou la pénibilité représentée par une tâche ou selon leur expérience. Le cas des objets est plus épineux et on aura davantage tendance à en évaluer le montant en se rapportant au Franc.\n\n<em>Mais, c''est trop comptabilisé!</em>\n-Rien n''empêche ceux qui avaient l’habitude de rendre un service gratuit de le faire, une fois ou l’autre, ou en partie.\n\n-L’expérience prouve que le SEL provoque la rencontre et génère le don.\n\n<em>Ce n’est pas grave d’avoir un compte SEL en négatif ?</em>\n-Pas du tout. Chacun commence avec un compte à zéro. Si j’ai versé 400 grains pour la guitare de Denis, son compte devient positif mais le mien, négatif, remontera au fur et à mesure que j’écoulerai mes confitures de banane à 10 grains le pot. Ainsi, dans un SEL, il y a nécessairement des adhérents qui ont un compte négatif, et d’autres un compte positif. La somme de tous les montants de tous les comptes est égale à zéro.\n\n<em>On peut rester dans le négatif indéfiniment ?</em>\n-Les limites sont entre -500 et +500 grains. Si un adhérent atteint cette limite, on lui rappelle les règles.\n\n<em>Qu’est-ce qui m’empêche de partir avec un compte négatif ?</em>\n-Un débit constitue un engagement à rendre au groupe des biens, des services, ou des savoirs. Or, dans le SEL, entre les personnes qui se rencontrent et font connaissance naît la confiance en même temps que l’engagement moral. En pratique, ça suffit pour que ce genre de comportement irresponsable soit très rare.\n\n<em>Quelle garantie a-t-on sur la qualité des biens ou des services proposés ?</em>\n-Aucune. C’est aux adhérents de discuter, pour savoir si l’un a le niveau de qualification que souhaite l’autre ou ce qui se passe si l’objet tombe en panne le lendemain, afin de se mettre d’accord avant l’échange. Pas de solution toute faite, ça passe par la discussion et la confiance. En cas de problème, il-y-a un-e\n\n<em>Mais c’est du travail au noir ? </em>\n-Non, il s’agit d’une entraide entre adhérents, pour des coups de main « ponctuels, non répétitifs et de courte durée ».\n-La pratique montre qu’énormément d’échan­ges qui n’auraient pas pu voir le jour dans le cadre classique du marché se font au sein des SEL. D’ailleurs, même si Marie demande à Bernard de l’aider à retapisser son appartement parce que ses fins de mois sont difficiles, c’est un autre artisan ou commerçant qui bénéficiera de l’argent économisé par Marie. Plus il y a de convivialité et de rencontres, plus il y a d’échanges, plus se créent des liens de proximité, entraînant de nouveaux échanges.\n\n<em>Mais moi je n’ai rien à proposer !</em>\n-C’est ce que dit tout le monde ! Ce que vous pouvez proposer ne vous paraît pas intéressant, s’il n’est pas compté comme travail salarié en Francs. Pourtant chacun possède une richesse à donner aux autres : faire de la pâtisserie, du bricolage, proposer les noix de son jardin, raconter des histoires aux enfants, écouter celui qui a un gros coup de cafard. Tout le monde, enfants, retraités, chômeurs, a quelque chose à proposer. Il suffit d’être à l’écoute de ses différences.\n-C’est fou ce qu’on peut découvrir alors comme nouveaux échanges quand on est à l’écoute de ses différences.', '<strong>A propos des SELs :</strong>\n<a href="http://www.lets-linkup.com/400-RestOfEurope.htm">LETS-linkup.com</a> - le site propose la liste des SELs présents dans chaque pays dont la Suisse. Incomplet mais utile.\n<a href="http://www.selidaire.org/">Selidaire</a> - informations générales sur le fonctionnement des SELs, forums, ...\n<a href="http://transversel.apinc.org/">Transversel</a> - information à propos des SELs. A jour, le plus vivant en français.', '', 1306465373, 2),
(7, 7, 0, 'FAQ', '<h3>Lexique</h3>\n<h5>Qu''est-ce qu''un échange \\"à confirmer\\"?</h5>\nC''est un échange en attente de confirmation de votre partenaire.\n<h5>Qu''est-ce qu''un échange \\"comptabilisé\\"?</h5>\nC''est un échange confirmé, qui a été débité/crédité dans les comptes respectifs.\n<h5>Vocabulaire SELs</h5>\nLes SELS évitent le vocabulaire financier car il ne faut pas confondre les deux systèmes!\n<ul><li>à la place de « chèque », utilisez « bon d’échange » ou « unités d’échange »</li>\n<li>évitez aussi « vendre » et « acheter » : on « donne », « offre », « échange », « propose », « reçoit »</li>\n<li>parlez d’« échange » plutôt que de « transaction ».</li>\n<li>parlez de « service » que vous rendez à quelqu’un qui en a besoin, de « richesse » que vous apportez ou recevez.</li></ul>\n<p>\n<h3>Votre Compte</h3>\n<h5>Comment accéder à mon compte?</h5>\nCliquez sur votre nom (en haut à droite).\n<h5>Comment changer mon email / mot de passe?</h5>\nCliquez sur votre nom (en haut à droite) > Modifier compte > Enregistrer les modifications.\n<h5>Comment changer mon adresse?</h5>\nCliquez sur votre nom (en haut à droite) > Modifier profil > Enregistrer les modifications.\n<h5>Comment consulter la liste de Mes Echanges?</h5>\nCliquez sur votre nom > Mes Echanges\n<h5>C''est quoi les Soldes?</h5>\n\\"solde\\": votre solde actuel (sans les grains \\"à confirmer\\")\n\\"à confirmer\\": les grains qui seront comptabilisés après la confirmation par votre partenaire\n\\"total\\": le total des grains (en positif) échangés depuis la mise en place du site\n<p>\n<h3>Infos</h3>\n<h5>La page \\"Infos\\" change continuellement!</h5>\nC''est vous qui faites vibrer ce lieu en visitant, contactant, échangeant et contribuant au SEL. Le comité gère la partie centrale de cette page et invite les membres à soumettre un article pour la page \\"Infos\\"\n***ENGLISH***\nby contacting an administrator with the contact block to the right\n***/ENGLISH***\n\n<h3>Offres & Demandes</h3>\n<h5>L''Offre/Demande/Échange apparaît dans la \\"mauvaise\\" catégorie (p.ex. \\"Divers\\")</h5>\nLe logiciel analyse toutes les mots dans vos annonces et les classe automatiquement dans la/les catégorie-s correspondante-s en utilisant un système de synonymes.\nCe n''est pas parfait, mais a l''avantage d''être évolutif, car les synonymes sont mis à jour régulièrement.\nSi votre Offre/Demande/Échange n''est pas dans la \\"bonne\\" catégorie, vous pouvez essayer de la modifier en changeant ou ajoutant quelques mots qui sont probablement dans la catégorie ciblée. Sinon, ce n''est pas grave, les membres vont la trouver par la recherche.\n<h5>Comment ajouter une Offre/Demande?</h5>\nIl y a plusieurs façons, mais voici la plus facile:\ncliquez sur votre nom > Mes Offres/Demandes > Créer une nouvelle Offre (ou Demande)\nOU cliquez sur \\"Offres\\" dans la navigation du haut > un formulaire apparaît en bas à gauche\ncliquez sur \\"Demandes\\" dans la navigation du haut > un formulaire apparaît en bas à gauche.\n<p>\n<h3>Membres</h3>\n<h5>Comment contacter un-e membre?</h5>\nVoici la méthode la plus facile:\ncliquez sur \\"Membres\\" dans la navigation du haut > cliquez sur leur nom ou n° de membre pour aller sur leur compte > cliquez sur l''onglet \\"contact\\".\n<h5>Comment envoyer un email à un-e membre?</h5>\nDepuis le compte du membre, cliquez sur \\"contact\\" sous l''affichage de son nom, rédigez et envoyez (vous pouvez vous envoyer une copie en cochant la case à coté du bouton \\"envoyer\\"). Nous avons choisi cette méthode pour faciliter la prise de contact ainsi que d''éviter l''abus des emails.\n<p>\n<h3>Échanges</h3>\n<h5>Comment saisir mes échanges 2008?</h5>\nL''objectif est de contrôler et saisir tous vos échanges 2008, sans faire trop de doublons.\n<ol><li>Téléchargez votre feuille d''échanges Excel du SELduLac qui se trouve dans la rubrique <a href=docs>Docs</a> du site \\"Feuilles d''échange des membres ... du 23/06/08\\"</li>\n<li>Imprimez-la pour pouvoir y faire référence pendant la saisie de vos échanges sur le site.</li>\n<li>Rassemblez vos feuilles d''échanges 2008 et biffez au crayon les échanges déjà comptabilisés sur la feuille d''échanges Excel que vous venez d''imprimer.</li>\n<li>Ensuite, dans la partie \\"Membres\\" du site, cliquez sur votre nom, ensuite cliquez sur \\"Mes Échanges\\". Vous avez la liste des échanges déjà saisis depuis la mise en ligne du site. Les échanges avec un voyant vert dans la colonne État sont comptabilisés et ne peuvent plus être modifiés. (Doublons? Voir plus bas). Les échanges avec voyant orange peuvent être modifiés ou supprimés, selon les besoins de votre saisie.</li>\n<li>Une fois que vous avez contrôlé et biffé les échanges déjà saisis sur la feuille Excel et le site, vous êtes prêts à saisir de nouveaux échanges.</li>\n<li>Cliquez sur \\"Saisir un Échange\\" sous votre nom en haut à droite, et en quelques minutes vous aurez saisi tous vos échanges! Veuillez décrire vos échanges en 4 mots minimum SVP pour qu''ils se trouvent dans la bonne catégorie savoir plus.</li></ol>\n\nDoublons?\nEssayez d''abord de \\"supprimer\\" l''échange en question. Sinon, vous pouvez saisir un échange de \\"correction\\" (avec la même personne mais les grains vont dans le sens contraire). Mettez dans la description: \\"correction de l''échange \\"X\\" le \\"X\\"\\".Voilà, c''est tout.\n\nJ''ai saisi toutes les feuilles d''échanges reçues avant le 15 juin de LA PERSONNE QUI A ENVOYÉ LA FEUILLE, mais l''échange n''a pas forcément été saisi chez la personne qui n''a pas envoyé sa feuille (pour le même échange). Ceci peut présenter des difficultés pour accorder les parties. A vous de faire preuve de souplesse et d''entente.\n\nSi vous n''avez pas de copies de vos feuilles d''échanges envoyé à moi depuis le 15 juin, je vous les renvoient volontiers.\n\nCourage, en faisant ce travail, pensez au comptable en grains qui l''as fait pendant des années pour 100 membres. ;)\n<h5>Comment Saisir un Échange?</h5>\nCliquez sur le lien \\"Saisir un Échange\\", sous votre nom en haut à droite.\nVous avez également la possibilité d''aller sur le compte d''un membre et utiliser le formulaire sur la gauche.\n<h5>Qui saisit l''échange sur le site?</h5>\nGénéralement la personne qui va verser des grains, ou selon accord. Ce qui est important est que vous contrôliez vos échanges \\"à confirmer\\" avant de faire la saisie d''un nouvel échange, pour éviter des doublons. Tant que votre partenaire n''as pas confirmé l''échange, vous pouvez le modifier ou le supprimer.\n<h5>Que faire si le partenaire n''a pas confirmé l''échange?</h5>\nD''abord, faire preuve d''un peu de patience. Certaines personnes ne consultent leurs emails qu''une fois par semaine. D''autres peuvent être en vacances ou absents pendant de longues périodes. Après un certain temps, vous pouvez les relancer par téléphone, ou éventuellement par email.\n<h5>Comment enregistrer un échange avec le SELdulac? (Compte 100)</h5>\nEn choisissant le Compte 100 comme partenaire dans l''échange. Un-e membre du comité va confirmer l''échange par la suite. Des exemples: des travaux du comité des fêtes et d''autres tâches pour l''association.\n<h5>Est-ce que je peux modifier un échange déjà saisi?</h5>\nOui, si votre partenaire dans l''échange n''a pas encore confirmé l''échange. Vous pouvez même le supprimer.\n<h5>Que faire si l''échange n''est pas accepté pour des raisons de solde (limite de +/-500 grains)?</h5>\nLe principe est que chacun contrôle le solde de l''autre avant d''entrer dans un échange important. Le trésorier en grains peut autoriser des dépassements pour une période maximale de 30 jours.\n<h5>Que veut dire la colonne \\"État\\"?</h5>\n\\"Vert\\" est un échange confirmé\n\\"Orange\\" est un échange qui attend confirmation de votre partenaire\n\\"Rouge\\" signifie que l''échange est entré en médiation\n<h5>Que faire en cas d''échanges doublons ? </h5>\nSi l''échange n''a pas encore été confirmé, la personne qui a saisi l''échange peut le supprimer.\nSi l''échange est confirmé, vous pouvez saisir un échange de \\"correction\\" (avec le même nombre de grains dans le sens inverse avec la même personne). Mettez dans la description: \\"correction de l''échange \\"X\\" le \\"X\\"\\". Donc, les deux échanges s''annulent.\n<p>\n<h3>Contributions</h3>\n<h5>Qu''est-ce-qu''une Contribution ?</h5>\nPartant du principe que si chaque membre contribue à son association, il-y-a moins besoin d''impôts (Contributions SELidaire), nous affichons dans la partie \\"Contributions\\" du site les petits coups de mains nécessaires au fonctionnement du SEL. Portez-vous volontaire pour ces tâches en contactant la personne dans la colonne de droite. Vous serez crédité d''un point \\"Contributions\\" pour chaque tâche accomplie.\n<h5>Marche à suivre : Chercher la clef de la Maison des Asters</h5>\nÉtant donné que la Maison du Quartier est fermé le lundi, vous devriez chercher la clef le vendredi précédent la Réunion de lundi.\n<h5>Marche à suivre : Ramener la clef</h5>\n<ol>\n<li>en course de redaction</li></ol>\n<h5>Marche à suivre : Noter les Présences d''un Repas de Lundi</h5>\n<ol><li>Copier et coller les noms des membres de cette page dans un logiciel comme Word.</li>\n<li>Imprimer un exemplaire de la liste</li>\n<li>Faire signer les membres quand ils arrivent à la Maison de Quartier</li>\n<li>Estimer le nombre de grains pour chaque plat apporté et noter le nombre à coté du nom du membre (ou demander à un-e membre du comité d''estimer la valeur si il-y-as désaccord)</li>\n<li>Remettre la \\"Feuille de Présence\\" à un-e membre de comité pour la saisi.</li></ol>\n<p>\n<h3>FAQ</h3>\n<h5>D''autres questions?</h5>\nContactez\n***ENGLISH***\nyour site administrator with the block to the right\n***/ENGLISH***\n<h3>Docs</h3>\n<h5>Comment imprimer une liste?</h5>\nCliquez sur l''icône \\"imprimante\\" qui se trouve en bas des pages. Toutes les pages n''ont pas encore cette possibilité. Conseil: Regardez l''aperçu avant d''imprimer, car les listes peuvent être longues. Pensez à limiter la consommation de papier en utilisant le site.\nNB: nous travaillons actuellement à rendre les listes plus imprimables\n<h3>Site</h3>\n<h5>Je n''ai pas accès aux informations</h5>\nSeuls les membres ayant saisi leur numéro de membre et leur mot de passe peuvent voir les détails des annonces et les adresses des membres.\n<h5>Pourquoi avoir fait un nouveau site?</h5>\nAvec l''augmentation importante du nombre des membres, la saisie des échanges et la répartition des tâches est devenue nécessaire.\nLe site vise également à :\n<ul><li>favoriser les échanges</li>\n<li>renforcer les liens entre les membres</li>\n<li>augmenter la transparence</li>\n<li>baisser la contribution solidaire (impôt).</li></ul>\n<h5>Voici ce qui est prévu pour les versions suivantes du site</h5>\n<b>Version 1.1 (ct 2009)</b>\n<em>Mon compte</em>\n<ul><li>travail de mise en page</li>\n<li>rationalisation de l''information</li>\n<li>paiement par internet des cotisations</li></ul>\n<i>Membres</i>\n<ul><li>façon plus élégante de chercher des membres</li></ul>\n<i>Échanges</i>\n<ul><li>recherche par catégories comme pour Offres et Demandes</li>\n<li>séparer les \\"Biens\\" des \\"Services & Savoirs\\"</li></ul>\n<i>Offres/Demandes</i>\n-afficher des photos pour les offres de biens\n<i>\\"Contributions\\" (SELidarité)</i>\n<ul><li>échanges pour un Franc Symbolique</li>\n<li>Annonces à l''attention des autres membres</li>\n<li>Tâches à Faire pour le SELduLac \\"Contributions\\" (fonctionne actuellement)</li>\n<li>Inscriptions pour ces tâches (en cours de réalisation)</li>\n<li>Remerciements après avoir effectué ces tâches (fonctionne actuellement)</li></ul>\n\n<b>Version 1.5 (2010)</b>\n<em>\\"Contributions\\" (SELidarité)</em>\n<ul><li>Sorties (cinema, sports, jeux, etc.)</li>\n<li>Parrainage des nouveaux membres</li>\n<li>Parrainage des Sans Internet Fixe</li></ul>\n\n<b>Version 2.0</b>\n<em>\\"Contributions\\" (SELidarité)</em>\n<ul><li>outils pour créer un SEL</li></ul>\n\nSi vous voulez faire d''autres suggestions\n***ENGLISH***\nutilise the contact block to the right\n***/ENGLISH***\n<h5>Qui a créé l''outil de base pour gérer les SELs?</h5>\nBonjour, nous sommes les créateurs de cet outil de gestion pour les SELs.\nMatthew Slater, un informaticien\nTim Anderson, un membre d''un SEL.\nNotre premier \\"client\\" était le SELduLac à Genève.A partir de notre outil, nous avons importé les données du SELduLac, adapté l''interface, formé des membres du comité et nous assurons le suivi et la maintenance pendant une année. Ceci pour l''échange de CHF 1''500.-.\nNous mettons à disposition des autres SELs nos compétences pour mettre en place cette même plateforme d''échanges. En cas d''intérêt, veuillez contacter', '', '', 1306465373, 2);
INSERT INTO `node_type` (`type`, `name`, `module`, `description`, `help`, `has_title`, `title_label`, `has_body`, `body_label`, `min_word_count`, `custom`, `modified`, `locked`, `orig_type`) VALUES
('community_task', 'Community tasks', 'community_tasks', 'A way to post tasks the community needs volunteers for, for members to volunteer for those tasks, and to be credited when the tasks are done.Tasks have three states - open, committed, and completed.', '', 1, 'A need to be met by a user', 1, 'Body', 0, 0, 0, 1, 'community_task'),
('currency', 'currency', 'mcapi', 'A unit of value', '', 1, 'Currency Name', 1, 'Rationale', 0, 0, 0, 1, 'currency'),
('exchange', 'exchange', 'mcapi', 'A record of an exchange between two users, denominated in a currency', '', 1, 'Description of entity traded', 0, '', 0, 0, 0, 1, 'exchange'),
('image', 'Image', 'image', 'An image (with thumbnail). This is ideal for publishing photographs or screenshots.', '', 1, 'Title', 1, 'Body', 0, 0, 0, 1, 'image'),
('offer', 'Offer', 'mc_offer_want', 'An entry in the offer directory.', '', 1, 'Product or service you are offering', 1, 'Body', 0, 0, 0, 1, 'offer'),
('page', 'Document', 'node', 'A <em>page</em>, similar in form to a <em>story</em>, is a simple method for creating and displaying information that rarely changes, such as an "About us" section of a website. By default, a <em>page</em> entry does not allow visitor comments and is not featured on the site''s initial home page.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, 'page'),
('simplenews', 'Newsletter issue', 'node', 'A newsletter issue to be sent to subscribed email addresses.', '', 1, 'Title', 1, 'Body', 0, 1, 0, 0, 'simplenews'),
('story', 'Article', 'node', 'A <em>story</em>, similar in form to a <em>page</em>, is ideal for creating and displaying content that informs or engages website visitors. Press releases, site announcements, and informal blog-like entries may all be created with a <em>story</em> entry. By default, a <em>story</em> entry is automatically featured on the site''s initial home page, and provides the ability to post comments.', '', 1, 'Title', 1, 'Body', 0, 1, 1, 0, 'story'),
('want', 'Want', 'mc_offer_want', 'An entry in the want directory.', '', 1, 'Product or service you need', 1, 'Body', 0, 0, 0, 1, 'want');
